import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <h2>Study Planner</h2>
      <ul>
        <li>
          <Link to="/g">Home</Link>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
